package adventofcode_2018;

import java.util.*;
import java.util.concurrent.CopyOnWriteArrayList;

public class AdventOfCode_2018_5 {

    public static void main(String... args) {
        String input = "";
        performoperation(new CopyOnWriteArrayList<>(Arrays.asList(input.split(""))));

    }

    public static List<String> performoperation (CopyOnWriteArrayList<String> chars) {

        //Add the object clones

        for (int i = 0; i < chars.size() - 2; i++) {
            if (matched(chars.get(i), chars.get(i + 1))) {
                chars.remove(i);
                chars.remove(i);
                i = -1;
            }

        }
        System.out.println(chars.size());
        return chars;
    }


    public static boolean matched(String a, String b) {
        if (a.equals(b)) {
            return false;
        }

        if (a.equalsIgnoreCase(b)) {
            return true;
        }

        return false;
    }
}
